//Cards.js

import React from 'react';
import { data } from '../data';
import './App.css';


const Cards = () => {
  return (
    <div>
      {data.map((image) => (
		<section className='column-left'>
        <div key={image.id}>
          <h3>{image.title}</h3>
          <img src={image.coverImg} alt={image.title} />

        </div>
		</section>
      ))}
    </div>
  );
};

export default Cards;

